import "./SideMenu.css";
import Avatar from "../../assets/icons/Iron_Man_icon.png";

const SideMenu = ({ userMessages }) => {
  return (
    <aside className="sidemenu">
      <div className="">
        <div className="sidemenu-me">
          <img src={Avatar} className="avatar-me" alt="Avatar" />
          User
        </div>
        <div className="user-messages">
          {userMessages.map((message, index) => (
            <p key={index}>{message}</p>
          ))}
        </div>
      </div>
    </aside>
  );
};

export default SideMenu;
